import { UPDATE_COUNT, UPDATE_IDS } from './actions';

export default (state = {}, action) => {
    switch (action.type) {
        case UPDATE_COUNT:
            return {
                ...state,
                count: action.count?.esearchresult?.count,
            };
        case UPDATE_IDS:
            return {
                ...state,
                ids: action.ids?.esearchresult?.idlist,
            };
        default:
            return state;
    }
};
